import React from 'react';
import { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import api from '../../services/api';

const Usuario = () => {
  const navigate = useNavigate();
  const [values, setValues] = useState({
    name: '',
    email: '',
    password: '',
  });

  const alterarValores = (event) => {
    const { name, value } = event.target;
    setValues((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  const createClickButton = async (event) => {
    event.preventDefault();
    try {
      const response = await api.post('/auth/register', {
        name: values.name,
        email: values.email,
        password: values.password,
      });
      alert(response.data.message);
      if (response.data.code === 1) {
        navigate('/');
      }
    } catch (error) {
      alert('Falha ao registrar usuário');
    }
  };

  return (
    <div className="cadastro--container">
      <div className="register--container">
        <h2>Cadastro de Usuario</h2>
        <label>Nome </label>
        <input
          type="text"
          name="name"
          placeholder="Digite o nome do Usuario"
          value={values.name}
          onChange={alterarValores}
          required
        />

        <br />

        <label>Email </label>
        <input
          type="email"
          name="email"
          placeholder="Digite o e-mail do Usuario"
          value={values.email}
          onChange={alterarValores}
          required
        />

        <br />

        <label>Password </label>
        <input
          type="password"
          name="password"
          placeholder="Digite o password"
          value={values.password}
          onChange={alterarValores}
          required
        />

        <br />

        <button className="register--buttton" onClick={createClickButton}>
          Enviar
        </button>
      </div>
    </div>
  );
};

export default Usuario;
